ally by anther culture in a self fertilised crop.',0,-1,0,211,0,1,14,19980610),(203,'DER','S','DPR','Purification','Selection of one or a few plants from an inbred line or pure line cultivar.',0,-1,0,0,0,1,18,19980610),(204,'DER','S','DRU','Roguing','Eliminating off types from a inbred line or pure line cultivar.',0,-1,0,0,0,1,0,19980610),(205,'DER','S','DSP','Single plant selection','Derivation through selection of a single plant, inflorescence, fruit or seed from a self fertilising population.',0,-1,0,221,0,1,11,19980610),(206,'DER','S','DSB','Selected bulk','Derived through bulking seed from a selected set of single plants from a self fertilising population.',0,-1,0,208,0,1,12,19980610),(207,'DER','S','DRB','Random bulk selection','Derivation through bulking seed from a random selection  of single plants from a self fertilising population.',0,-1,0,0,0,1,21,19980610),(208,'DER','S','DSD','Single seed descent','Derived through the production of a single individual without selection from each individual in a segregating population.',0,-1,0,0,0,1,13,19980610),(209,'DER','S','DRS','Restorer selection','Restorer Lines selected at the end of a program to back cross a gene which restores male fertility to lines carrying a Male Sterile Cytoplasm (CMS).',0,-1,0,221,0,1,31,19980610),(210,'DER','S','DMS','CMS maintainer selection','Maintainer lines selectedat the end of a program to back cross a gene which restores male fertility to lines carrying a Male Sterile Cytoplasm (CMS)',0,-1,0,0,0,1,0,19990000),(211,'GEN','S','CBC','CMS backcross','-',0,2,1,0,0,0,0,0),(251,'DER','S','ALP','Landrace population','Acquisition only. A Landrace Accession of a self fertilised species. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,15,19980610),(252,'DER','S','ALL','Landrace line','Acquisition only. When the accession derives from a single plant in the Landrace Population. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,0,19980610),(253,'DER','S','ALC','Landrace cultivar','Acquisition only. A Landrace Cultivar Accession of a self fertilised species. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,0,19980610),(254,'DER','S','ACP','COLLECTION POPULATION SF','Acquisition only. An accession of a population of a cultivated self fertilising species not from farmers fields.',0,-1,0,0,0,1,0,19980610),(255,'DER','S','ACL','Collection line','Acquisition only. When the an accession derives from a single plant in a Collection. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,17,19980610),(256,'DER','S','AWP','Collection wild spp population','Acquisition only. An accession of a  self fertilising species. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,16,19980610),(257,'DER','S','AWL','Collection wild spp line','Acquisition only. When the accession derives from a single plant from a wild collection. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,0,19980610),(258,'DER','S','ADP','Collection weedy spp population','Acquisition only. An accession of a  self fertilising species which is a weed. DEPRECATED! Wrongly mixes up the concept of collecting from in situ conditions with the concept of acquisition into an ex situ collection',0,-1,0,0,0,1,24,19980610),(259,'DER','S','ADL','Collection weedy spp line','Acquisition only. When the accession derives from a single plant in a collection of weedy species. DEPRECATED! Wrongly mixes up the concept of collectin