IC NUCLEUS CF','Individual derived from genetic transformation of the nucleus in a cross fertilising species. This is only done in an inbred line.',0,1,0,211,0,1,0,19980610),(458,'GEN','O','OTC','TRANSGENIC CYTOPLASM CF','Individual derived from genetic transformation of a cytoplasm inclusion (eg chloroplast)  in a cross fertilising species. This is only done in an inbred line.',0,1,0,211,0,1,0,19980610),(501,'DER','O','MIP','SELECTION FOR INDUCED MUTATION POP','Selection in a population for a mutation.',0,-1,0,211,0,1,0,19980610),(502,'DER','O','DHP','DOUBLE  HAPLOID POP','Population produced by doubling haploid individuals.',0,-1,0,211,0,1,0,19980610),(503,'DER','O','DRP','ROGUING CF','Eliminating off types from an open pollinated variety. Equivalent to a light mass selection.',0,-1,0,0,0,1,0,19980610),(504,'DER','O','DSO','SINGLE PLANT SELECTION CF','Selection of a single plant, inflorescence, fruit or seed from a cross fertilising population. When this selection is done after selfing the population used the method  (205) described for inbreeding species.',0,-1,0,0,0,1,0,19980610),(505,'DER','O','DSP','SINGLE SEED DESCENT CF','The production of a single individual  without selection from selfing individuals in an cross fertilised species. This is the same procedure (208) used in self fertilising species.',0,-1,0,0,0,1,0,19980610),(506,'DER','O','PRS','RESTORER SELECTION','Restorer Lines selected at the end of a program to back cross a gene which restores male fertility to lines carrying a Male Sterile Cytoplasm (CMS).',0,-1,0,221,0,1,0,19980610),(507,'DER','O','DRP','Random bulk','Production of next generation by random mating.',0,-1,0,0,0,1,0,19980610),(508,'DER','O','FMS','FULL MASS SELECTION','Production of next generation by selecting before pollination, selecting on both male and female sides.',0,-1,0,221,0,1,0,19980610),(509,'DER','O','HMS','HALF MASS SELECTION','Production of next generation by selecting after pollination; selection on female side only.',0,-1,0,221,0,1,0,19980610),(551,'DER','O','BLP','LANDRACE POPULATION CF','Acquisition only. A Landrace Accession of a cross fertilised species. This population will consist of a heterogenous mixture of heterozygous genotypes. This should be reserved for the acquisition of this type of population to any program when they are fir',0,-1,0,0,0,1,0,19980610),(553,'DER','O','BLC','LANDRACE CULTIVAR CF','Acquisition only. A Landrace Cultivar Accession of a cross fertilised species. Accession of a long term cultivar, not bred or maintained by modern breeding methods. This would usually be less heterogenous than a traditional landrace.',0,-1,0,0,0,1,0,19980610),(554,'DER','O','BCP','COLLECTION POPULATION CF','Acquisition only. An accession of a population of a cultivated cross  fertilising species not from farmers fields.',0,-1,0,0,0,1,0,19980610),(556,'DER','O','BWS','COLLECTION WILD SPP POPULATION CF','Acquisition only. An accession of a cross fertilising species.',0,-1,0,0,0,1,0,19980610),(558,'DER','O','BWL','COLLECTION WEEDY SPP POPULATION CF','Acquisition only An accession of a cross  fertilising species which is a weed (because of the result of a hybrid between the cultivated and a wild species of  the crop) .',0,-1,0,0,0,1,0,19980610),(601,'MAN','O','MPO','SEED INCREASE OPEN POLLINATION CF','Open pollination of an unselected set of individuals in isolation and all seed bulked. Here the aim is to maintain a population, not recombine a set of selected families.',0,-1,0,215,0,1,0,19980610),(603,'MAN','O','MFB','SEED INCREASE FULL DIALLEL CROSS BULKED','Each parent mated to all others, including all reciprocals but not selfs, usually not in isolation and all seed bulked. Here the aim is to maintain a population, not recombine a set of selected families.',0,-1,0,215,0,1,0,19980610),(605,'MAN','O','MHB','SEED INCREASE HALF DIALLEL CROSS BULKED','Each parent mated to all others, no selfs and  reciprocals not recorded, usually not in isolation and all seed bulked. Here the aim is to maintain a population, not recombine a set of selected families.',0,-1,0,215,0,1,0,19980610),(606,'MAN','O','MPB','SEED INCREASE PARTIAL DIALLEL CROSS BULKED','Each parent mated to some but not all other parents in a pattern, no selfs, usually not in isolation and all seed bulked. Here the aim is to maintain a population, not recombine a set of selected families.',0,-1,0,215,0,1,0,19980610),(607,'MAN','O','MSC','SEED INCREASE SUBSET CROSS','Parents dived into sets and bulked pollen from each set used to pollenate other sets, usually not in isolation. Self fertilisation avoided, all seed bulked. Here the aim is to maintain a population, not recombine a set of selected families.',0,-1,0,216,0,1,0,19980610),(621,'MAN','O','WHY','HYBRID FORMATION CF','Forming a hybrid CV in a cross fertilising crop.',0,-1,0,211,0,1,0,19980610),(622,'MAN','O','WML','SYNTHETIC FORMATION CF','Forming a synthetic CV in a cross fertilising crop',0,-1,0,211,0,1,0,19980610),(623,'MAN','O','WBS','BREEDERS SEED CF','Producing Breeders Seed. Pure seed  produced by breeder (usually some kept by breeder)  in a cross fertilising crop.',0,-1,0,211,0,1,0,19980610),(624,'MAN','O','WFS','FOUNDATION SEED CF','Producing Foundation Seed. Pure seed derived from Breeders Seed (usually kept by seed producing organisation) in a cross fertilising crop.',0,-1,0,211,0,1,0,19980610),(625,'MAN','O','WCS','CERTIFIED SEED','Producing Certified Seed. Pure seed produced under supervision by Government Protocols.',0,-1,0,211,0,1,0,19980610),(626,'MAN','C','WCR','CULTIVAR RELEASE','Release a cultivar',0,-1,0,104,0,1,0,19980610),(901,'MAN','C','NCI','CLONE INCREASE TRADITIONAL','Propagate the clone via the normal vegetative material.',0,-1,0,0,0,1,0,19980610),(902,'MAN','C','NCT','CLONE INCREASE TISSUE CULTURE','Propagate the clone via tissue culture.',0,-1,0,0,0,1,0,19980610),(903,'MAN','C','NCR','CLONE INCREASE REGENERATION','Regenerate the clone from tissue culture.',0,-1,0,0,0,1,0,19980610),(911,'MAN','C','SCF','CLONE MAINTAINED FIELD','Clone maintained in a germplasm garden in the field in the traditional manner.',0,-1,0,0,0,1,0,19980610),(912,'MAN','C','SCT','CLONE MAINTAINED TISSUE CULTURE','Clone maintained as a tissue culture.',0,-1,0,0,0,1,0,19980610),(921,'MAN','C','VCF','CLONE FORMATION','Formation of a clone as a cultivar.',0,-1,0,104,0,1,0,19980610),(922,'MAN','S','PLH','Polished rice','The GID is used to represent a sample of polished rice',0,-1,0,211,0,1,0,20050718),(923,'MAN','S','SSN','Single seed numbering','NUMBERING SINGLE SEEDS FROM A CROSS WITHOUT GENERATION ADVANCE',0,-1,0,0,0,1,26,19980415),(426,'GEN','O','TCR','TOPCROSS','Crosses made for generating hybrids for early generation testing. The females can be lines in any generation of inbreeding, and DH lines, and the male is usually a fixed inbred line, or a F1 single cross between two fixed inbred lines.',0,2,1,0,0,0,0,20140117);
