INSERT INTO `udflds` VALUES (1,'NAMES','NAME','ACCNO','Germplasm bank accession ID','-','ID given to an accession by the genebank holding it. The location of the name and the location of the germplasm should both be the location of the holding genebank.',1,0,0,0),(2,'NAMES','NAME','CRSNM','Cross name','-','Name assigned to a cross. The location of the name and the location of the germplasm is the location where the cross was made, and the method of creation specifies the type of cross',2,0,0,0),(3,'NAMES','NAME','UNCRS','Unnamed cross','-','Pedigree notation for an unnamed cross. The location of the name and the location of the germplasm is the location where the cross was made, and the method of creation specifies the type of cross.',3,0,0,0),(4,'NAMES','NAME','RELNM','Release name','-','The official name assigned when the germplasm was formally released as a cultivar. The location of the germplasm is the region (often the country), where the cultivar was released.',4,0,0,0),(5,'NAMES','NAME','DRVNM','Derivative name','-','A name given to a line that was selected from a variable parent such as a segregating population.Often the name starts with a prefix the same as its parents name, and has a suffix indicating the selection.The name location is where the selection was made.',5,0,0,0),(6,'NAMES','NAME','CVNAM','Cultivar name','-','The name of a cultivar of any type ',6,0,0,0),(7,'NAMES','ABBREVIATION','CVABR','Abbreviated cultivar name','-','-',14,0,0,0),(8,'NAMES','NAME','SPNAM','Species name','-','DO NOT USE! This is replaced with an attribute',0,0,0,0),(9,'NAMES','NAME','COLNO','Collector\'s number','-','ID assigned by a collector to a sample collected from a farm, market place etc, to identify the sample uniquely within the collecting mission. The location of the name is the location of the collecting mission.',0,0,0,0),(10,'NAMES','NAME','FACCN','Accession ID in other genebank','-','ID assigned by another genebank holding a copy of the same material. The location of the name is the location of the genebank holding the copy.',0,0,0,0),(11,'NAMES','NAME','ITEST','International testing number','-','ID assigned by the coordinator of an international variety testing network. The name location is the location of the network coordinator',0,0,0,0),(12,'NAMES','NAME','NTEST','National testing number','-','ID assigned by the coordinator of a national variety testing network. The name location is the location of the network coordinator',0,0,0,0),(13,'NAMES','NAME','LNAME','Line name','-','Name assigned normally to a bred line. ',0,0,0,0),(14,'NAMES','NAME','TACC','Temporary / quarantine ID','-','-',0,0,0,0),(15,'NAMES','NAME','ADVNM','Alternative derivative name','-','-',0,0,0,0),(16,'NAMES','NAME','ACVNM','Alternative cultivar name','-','-',0,0,0,0),(17,'NAMES','NAME','AABBR','Alternative abbreviation','-','-',0,0,0,0),(20,'NAMES','NAME','ELITE','Elite lines','-','-',0,0,0,0),(21,'NAMES','NAME','GACC','Management name','-','ID given to a sample created by a maintenance method within a management neighbourhood e.g. a generation of a genebank accession. Format in IRRI GRC is [ACCNO]:[YYYYXX], where [YYYYXX] is the year and season (DS or WS) of seed production',0,112,20060320,0),(22,'NAMES','NAME','DACCN','Donor\'s accession ID','-','For a germplasm sample obtained from a genebank, this records the accession ID assigned by the donating genebank to its own sample. The location of the name is the location of the donating genebank.',0,112,20060522,0),(23,'NAMES','NAME','LCNAM','Local common name','-','Local common name given to wild rice species',0,112,20060525,0),(27,'NAMES','NAME','TRN_ID','Transgenic event ID','-','Transgenic Event ID',0,0,20090312,0),(28,'NAMES','NAME','ALTCRSNM','Alternative cross name','-','-',2,0,0,0),(30,'NAMES','NAME','DEPRCTD','Deprecated name',' -',' Deprecated variant spelling',0,310,20100421,0),(103,'ATRIBUTS','ATTRIBUTE','NOTE','NOTES','-','NOTES CONCERNING GERMPLASM ORIGIN, DEVELOPMENT NOMENCLATURE OR CRON